jobInfo.postDescription:
1、参加基于Java技术的项目开发;
2、参与系统分析与设计，并负责完成项目模块核心代码开发;
3、根据开发规范与流程在产品框架基础上独立完成模块的
设计、编码、测试以及相关文档;
4、能独立解决开发中遇到的难点问题;
5、负责开发过程中相关新技术的研究和验证。任职要求:
1、计算机相关专业，专科以上学历，2-3年及以上Java开
发经验;
2、Java基础扎实，对java语言规范有深刻理解
3、熟悉软件技术文档的编写，具备良好的文档编制习惯和
代码书写规范;
4、熟悉iavascript、html/xhtml、xml、CSS、AJAX等技术;
5、熟悉Spring boot，SpringCloud，SpringMvc，MyBatis等主流的开发框架，熟悉mybatis等ORM中间件;
6、熟悉MySQL、OraclesqlServer等其中一种数据库有sql优化经验者优先;
7、掌握常用的开发工具，如idea，eclipse，maven，git, svn等;
8、熟练Linux操作系统基本操作命令，熟悉dubboredis
MQ、等常用中间件;
9 有微信公众号、小程序开发经验优先考虑;
10、具有较强的学习、分析问题解决问题的能力，具有良好的团队合作精神及灵活的沟通的能力。
